import sys
import runpy

import runbytes


# Simple app that returns 5 as a result of simple calculations.
APP = ''
APP_NAME = 'app.pyz'


def main():
    path_hook = runbytes.hook(APP_NAME, APP)
    sys.path_hooks.append(path_hook)
    runpy.run_path(APP_NAME)


if __name__ == '__main__':
    main()
